#
# TABLE STRUCTURE FOR: Course
#

DROP TABLE IF EXISTS `Course`;

CREATE TABLE `Course` (
  `crsCode` varchar(255) NOT NULL,
  `deptId` int(9) NOT NULL,
  `crsName` varchar(100) NOT NULL,
  `descry` varchar(255) NOT NULL,
  KEY `crsCode` (`crsCode`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Professor
#

DROP TABLE IF EXISTS `Professor`;

CREATE TABLE `Professor` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `deptId` int(9) unsigned NOT NULL,
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1002 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Student
#

DROP TABLE IF EXISTS `Student`;

CREATE TABLE `Student` (
  `id` int(9) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `address` varchar(255) NOT NULL,
  `status` enum('enrolled','unenrolled') NOT NULL,
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10002 DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Teaching
#

DROP TABLE IF EXISTS `Teaching`;

CREATE TABLE `Teaching` (
  `profId` varchar(255) NOT NULL,
  `crsCode` varchar(255) NOT NULL,
  `semester` varchar(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;



#
# TABLE STRUCTURE FOR: Transcript
#

DROP TABLE IF EXISTS `Transcript`;

CREATE TABLE `Transcript` (
  `studId` int(9) NOT NULL,
  `crsCode` int(9) NOT NULL,
  `semester` enum('spring','summer','fall') NOT NULL,
  `grade` tinyint(2) unsigned NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


#
# TABLE STRUCTURE FOR: Transcript
#

DROP TABLE IF EXISTS `Transcript`;

CREATE TABLE `Transcript` (
  `crsCode` int(9) unsigned NOT NULL,
  `studId` int(9) unsigned NOT NULL,
  `semester` varchar(255) NOT NULL,
  `grade` tinyint(3) unsigned NOT NULL,
  KEY `studId` (`studId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;






